abount_sleep_tip:
1. Opbyg regelmæssige søvnvaner ved at gå i seng og stå op på samme tid hver dag;
2. Sluk lyset når du går i seng for at holde rummet mørkt, stille og med en passende temperatur;
3. Undgå intens motion før sengetid, og spis ikke for meget, men gå heller ikke sulten i seng;
4. Reducer brugen af elektroniske apparater (som mobiltelefoner, computere, tv osv.) før sengetid;
5. Ryg ikke og drik ikke koffeinholdige/alkoholiske/stimulerende drikke før sengetid.
